    def __init__(self, elements: Set[Any], operation: callable):
        self.elements = elements
        self.operation = operation

        # Check group axioms
        self._check_closure()
        self._check_associativity()
        self._check_identity()
        self._check_invertibility()

    def _check_closure(self):
