import { useTooltip } from '../context/TooltipContext';

const Tooltip = ({ id, children, content }) => {
  const { openTooltipId, openTooltip, closeTooltip } = useTooltip();

  useEffect(() => {
    if (openTooltipId === id) {
      // Tooltip is open
    } else {
      // Tooltip is closed
    }
  }, [openTooltipId, id]);

  const handleMouseEnter = () => {
    openTooltip(id);
  };

